webpackJsonp([0x8abce5a37e4d],{3622:function(t,e){t.exports={data:{markdownRemark:{html:'<p>100,000アクセス記念リニューアル。<del>ハーボット飼育開始</del>。サービス終了につき削除しました。 とにかく、無性に人工無能が作りたくなってきました。ですので、一応下記に目標を立てておきます。</p>\n<ul>\n<li><a href="http://www.mirai.ne.jp/%7Emikeneko/yuibot/yui/chat/free/Bot/bot.html">ゆいぼっと</a>のようにチャットに組み込んで使う</li>\n<li>出来た物体はリアルタイムにGPLとして公開・配布する</li>\n<li>制作期間は2年ほど(あんまり急いでも頓挫がオチ)</li>\n<li>目標は、そうだな…とりあえず<em>『<a href="http://www.din.or.jp/%7Eohzaki/uzura.htm">うずら</a>』</em>辺りで(!!)\nいきなり無茶もいいところですね。10億人中10人たどり着ければ良い方でしょうか。まずはゆいぼっとを設置して、CGIの中身から実際の動きまで細々と観察してみることにします。 さて、<em>RPGツクール</em>をやる時間がなくなるので今日はここまで。</li>\n</ul>',frontmatter:{cover:null,date:"2003-01-20T00:00:00+09:00",strDate:"2003/1/19",title:"無性に人工無能が作りたくなる"}}},pathContext:{path:"/ja/blog/2003/01/20-無性に人工無能が作りたくなる/",langKey:"ja"}}}});
